import React, { useEffect, useState } from 'react';
import './App.css';

import scale from './assets/radaltback.png';
import cover from './assets/radaltcover.png';
import needle from './assets/radaltneedle.png';
import bugImg from './assets/bug.png';
import flagImg from './assets/radaltflag.png';

function App() {
  const [hasPower, setHasPower] = useState(true)

  console.log(scale.width)

  const toggleHasPower = () => {
    setHasPower(!hasPower)
  }

  return (
    <div>
      <h1>Radar Altimeter</h1>
      <div>
        <img class='image_pos' alt='' src={scale} />
        <img class='image_pos' alt='' src={cover} />
        <img class='image_pos' alt='' src={needle} />
        <img class='image_pos' alt='' src={bugImg} />
        <img class='image_pos' alt='' src={flagImg} />
      </div>

      <h2>{}</h2>
      <button style={{position: 'absolute', top: scale.width}} onClick={toggleHasPower}>
        Has Power
      </button>
    </div>
  );
}

export default App;
